import React, { useEffect } from 'react';
import { Card, Button, CardTitle, CardText, Row, CardBody, Container, CardSubtitle } from 'reactstrap';
import { connect } from 'react-redux';
import { deleteItemFromCart } from '../../actions/cart';
import { Item as ItemType } from '../../reducers/types';

function Item(props: any): JSX.Element {
    const item = props.items.filter((item) => item.id === props.itemId);
    return (
        <Container>
            <Row>
                <div>
                    <Card>
                        <CardBody>
                            <CardTitle>Card title</CardTitle>
                            <CardSubtitle>Card subtitle</CardSubtitle>
                            <CardText>
                                Some quick example text to build on the card title and make up the bulk of the content.
                            </CardText>
                            <Button>Button</Button>
                        </CardBody>
                    </Card>
                </div>
            </Row>
        </Container>
    );
}

const mapStateToProps = (state: any) => {
    console.log(state);
    return {
        items: state.items.items,
    };
};

export default connect(mapStateToProps, { deleteItemFromCart })(Item);
